import React from "react";
import "./Image_input_field.css";

const Image_input_field = () => {
  return (
    <div className="" style={{}}>
      <h1> Hi</h1>
      <h1> #1</h1>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Aperiam illum
        omnis sequi error autem placeat vel totam voluptas, beatae enim suscipit
        quod, sint doloribus aliquam rem non ipsam ex vitae.
      </p>
      <div
        className=""
        style={{
          display: "flex",
          justifyContent: "center",
          padding: "50px",
        }}
      >
        <div className="input-form-div">
          <div className="">
            <input
              className="input"
              type="text"
              style={{ fontSize: "20px", height: "30px", width: "500px" }}
            />
            <button
              style={{
                fontSize: "20px",
                padding: "3.5px",
                cursor: "pointer",
                background: "#2ac38a",
                color: "#fff",
                borderTopRightRadius: "5px",
                borderBottomRightRadius: "5px",
              }}
            >
              Submit
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Image_input_field;
